  \"The Coral Reef Temperature Anomaly Database (CoRTAD) Version 5 - Global, 4 km
  Sea Surface Temperature and Related Thermal Stress Metrics for 1982-2012 (NCEI Accession
  0126774)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:56.750394\",\n\t\"name\":
  \"the-coral-reef-temperature-anomaly-database-cortad-version-5-global-4-km-sea-surface-tempe\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Version 5 of the Coral Reef Temperature
  Anomaly Database (CoRTAD) is a global, 4 km, sea surface temperature (SST) and related
  thermal stress metrics dataset for 1982-01-02 to 2012-12-28. The CoRTAD contains
  weekly-averaged SSTs, SST anomaly (SSTA, weekly SST minus weekly climatological
  SST), thermal stress anomaly (TSA, weekly SST minus the maximum weekly climatological
  SST), SSTA Degree Heating Week (SSTA_DHW, sum of previous 12 weeks when SSTA is
  greater than or equal to 1 degree C), SSTA Frequency (number of times over previous
  52 weeks that SSTA is greater than or equal to 1 degree C), TSA DHW (TSA_DHW, also
  known as a Degree Heating Week, sum of previous 12 weeks when TSA is greater than
  or equal to 1 degree C), and TSA Frequency (number of times over previous 52 weeks
  that TSA is greater than or equal to 1 degree C). In addition, the CoRTAD includes
  ancillary sea ice concentration and marine wind speed data.These data are the fifth
  in the series of CoRTAD datasets originally created in association with Elizabeth
  Selig (Director, Marine Science, Conservation International) and John Bruno (University
  of North Carolina; UNC - Chapel Hill). This dataset is based on the Pathfinder V5.2
  dataset, and is created with support from the NOAA Coral Reef Conservation Program.\",\n\t\"license_title\":
